import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import axios from 'axios';

const Login = () => {
  const [formData, setFormData] = useState({
    email: '',
    password: ''
  });
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setLoading(true);
    
    try {
      // For now, simulate login
      // In real app: await axios.post('/api/login', formData);
      
      setTimeout(() => {
        if (formData.email === 'authority@test.com') {
          localStorage.setItem('token', 'mock-token');
          localStorage.setItem('user', JSON.stringify({
            email: formData.email,
            role: 'authority'
          }));
          navigate('/authority');
        } else {
          localStorage.setItem('token', 'mock-token');
          localStorage.setItem('user', JSON.stringify({
            email: formData.email,
            role: 'visitor'
          }));
          navigate('/dashboard');
        }
        setLoading(false);
      }, 1000);
      
    } catch (err) {
      setError(err.response?.data?.error || 'Login failed');
      setLoading(false);
    }
  };

  return (
    <div className="container mt-5">
      <div className="row justify-content-center">
        <div className="col-md-6">
          <div className="card shadow">
            <div className="card-header bg-primary text-white">
              <h4 className="mb-0">Login to CareMyPark</h4>
            </div>
            <div className="card-body">
              {error && (
                <div className="alert alert-danger">{error}</div>
              )}
              
              <form onSubmit={handleSubmit}>
                <div className="mb-3">
                  <label className="form-label">Email Address</label>
                  <input
                    type="email"
                    className="form-control"
                    name="email"
                    value={formData.email}
                    onChange={handleChange}
                    placeholder="Enter your email"
                    required
                  />
                </div>
                
                <div className="mb-3">
                  <label className="form-label">Password</label>
                  <input
                    type="password"
                    className="form-control"
                    name="password"
                    value={formData.password}
                    onChange={handleChange}
                    placeholder="Enter your password"
                    required
                  />
                </div>
                
                <button 
                  type="submit" 
                  className="btn btn-primary w-100"
                  disabled={loading}
                >
                  {loading ? 'Logging in...' : 'Login'}
                </button>
              </form>
              
              <div className="mt-3 text-center">
                <p className="mb-0">
                  Don't have an account?{' '}
                  <Link to="/register" className="btn btn-link p-0">
                    Register here
                  </Link>
                </p>
                
                <div className="mt-3">
                  <small className="text-muted">
                    <strong>Test Accounts:</strong><br />
                    Visitor: visitor@test.com / any-password<br />
                    Authority: authority@test.com / any-password
                  </small>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
